import React from "react";

export default function Category(props) {
  return (
    <div>
      <h3>Category</h3>
      <p>one category dances</p>
      {props.dances.filter(dance => (
        <>
          <p>{dance.name}</p>
        </>
      ))}
    </div>
  );
}
